import { Navigate } from "react-router-dom";
export default function IsLoggedIn() {
  if (localStorage.getItem("user")) {
    return true;
  } else {
    return false;
  }
}

export const logout = () => {
  console.log("logout");
  localStorage.removeItem("user");
};

export const getCurrentUser = JSON.parse(localStorage.getItem("user"));
